import React from 'react';
import styled from './splitStyle';

const split = () => (
  <>
    <styled.FilterTimeSlide>
      <styled.FilterTimeSlideInner
      /* rangeMinPercent={rangeMinPercent}
          rangeMaxPercent={rangeMaxPercent} */
      />
    </styled.FilterTimeSlide>
    <styled.FilterPriceRangeWrap>
      <styled.FilterPriceRangeMin type="range" />
      <styled.FilterPriceRangeMax type="range" />
    </styled.FilterPriceRangeWrap>
  </>
);

export default split;
